import Header from '../components/header'

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
  };

  const Layout = props => (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  )

  const withLayout = Page => {
    return () => (
      <div style={layoutStyle}>
        <Header />
        <Page />
      </div>
    )
  }

export { withLayout, Layout }
